import {BUY_CAKE,CREATE_CAKE,GET_CAKE} from './cakeType'

export const buyCake=()=>{
    return {
        type:BUY_CAKE
    }
}
export const createCake=(post)=>{
    return {
        type:CREATE_CAKE,
         payload:post
    }
}
export const getCake =()=>{
    return {
    type:GET_CAKE
    }
}
